import React from 'react'

import Swal from 'sweetalert2'

export const Vsualizacion = (props) => {
    const {historial} = props
    const handleOnClick = () => {

        const { value: formValues } = Swal.fire({
            title: 'Registrar Historial Clinico',
            html:
              '<input id="swal-input1" class="swal2-input">' +
              '<input id="swal-input2" class="swal2-input">',
            focusConfirm: false,
            preConfirm: () => {
              return [
                document.getElementById('swal-input1').value,
                document.getElementById('swal-input2').value
              ]
            }
          })
        console.log(value)

          if (formValues) {
            Swal.fire(JSON.stringify(formValues))
          }

    }
    return (
        <div>
            <div className="row d-grid justify-content-end">
                <div className="col">
                    <button className ="btn btn-primary" onClick={handleOnClick}>Nuevo</button>
                </div>
            </div>

            <div className="row ">
                <div className="col-12">
                    fecha: {historial.fecha}
                </div>
                <div className="col-12">
                    razon_ingreso: {historial.razon_ingreso}
                </div>
                <div className="col-12">
                    detalles: {historial.detalles}
                </div>
            </div>
        </div>



    )
}
